async def main():
    resolvers = [make_resolver(ns, INITIAL_TIMEOUT) for ns in DEFAULT_NAMESERVERS]
    init_resolver_state(len(resolvers))
    start_time = time.perf_counter()

    async def _progress_task(progress, total, start_time):
        try:
            while True:
                await asyncio.sleep(0.2)
                render_progress_stderr(progress.get('processed', 0), total, start_time, progress.get('found', 0))
        except asyncio.CancelledError:
            return

    # Robust strict wildcard check.
    enabled, common_ips = await check_strict_wildcard(PARENT, resolvers, INITIAL_TIMEOUT, need=3, max_probes=12)
    if enabled:
        sys.stderr.write(
            f"[fatal] wildcard DNS detected: random labels consistently resolved to: {', '.join(sorted(common_ips))}.\n"
            "Brute-force enumeration is not viable; aborting.\n"
        )
        sys.stderr.flush()
        sys.exit(2)

    # Strict wildcard check: if 3 random subdomains resolve to the same IPs, stop.
    enabled, common_ips = await check_strict_wildcard(PARENT, resolvers, INITIAL_TIMEOUT, need=3)
    if enabled:
        sys.stderr.write(f"[fatal] wildcard DNS detected (all random labels map to: {', '.join(sorted(common_ips))}). Brute force is not viable; exiting.\n")
        sys.stderr.flush()
        return



    wildcard_ips = await detect_wildcard(PARENT, resolvers, INITIAL_TIMEOUT, probes=3)
    if wildcard_ips:
        sys.stderr.write(f"[info] wildcard detected; ignoring IPs: {', '.join(sorted(wildcard_ips))}\n")
        sys.stderr.flush()

    q = asyncio.Queue()
    limiter = DynamicSemaphore(INITIAL_CONCURRENCY)
    timeout_ref = {'value': INITIAL_TIMEOUT}
    progress = {'processed': 0, 'attempted': 0, 'found': 0}
    _labels = list(subs_set)
    total_labels = len(_labels)
    try:
        sys.stderr.write(f"[info] brute-force target count: {total_labels}\n")
        sys.stderr.flush()
    except Exception:
        pass
    for s in _labels:
        await q.put(str(s).strip().lower())
    workers = [
        asyncio.create_task(worker(q, PARENT, limiter, resolvers, timeout_ref, wildcard_ips, progress))
        for _ in range(INITIAL_CONCURRENCY)
    ]

    tuner = asyncio.create_task(adjuster_task(limiter, resolvers, q, timeout_ref))

    prog = asyncio.create_task(_progress_task(progress, total_labels, start_time))

    await q.join()

    for _ in workers:
        await q.put(None)
    await asyncio.gather(*workers, return_exceptions=True)
    try:
        prog.cancel()
        await prog
    except Exception:
        pass
    render_progress_stderr(progress.get('processed', 0), total_labels, start_time, progress.get('found', 0))
    try:
        sys.stderr.write('\n')
        sys.stderr.flush()
    except Exception:
        pass
    tuner.cancel()
    try:
        await tuner
    except asyncio.CancelledError:
        pass

    # --- stats ---
    end_time = time.perf_counter()
    duration = max(1e-6, end_time - start_time)
    attempted = progress.get("attempted", 0)
    found = progress.get("found", 0)
    avg_per_sec = attempted / duration if duration > 0 else float(attempted)
    sys.stderr.write(f"[stats] duration={duration:.2f}s attempted={attempted} found={found} avg_per_sec={avg_per_sec:.2f}\n")
    sys.stderr.flush()


if __name__ == '__main__':
    try:
        asyncio.run(main())
    except KeyboardInterrupt:
        pass
